(function(){var loadHandler=window['sl_{8800508C-586C-412E-96F7-4011709AF3FB}'];loadHandler&&loadHandler(24, '<div id="spr0_3601254"><div id="spr1_3601254" class="kern slide"><img id="img3_3601254" src="data:image/png;base64," width="960px" height="540px" alt="" style="left:0px;top:0px;"/><div id="spr3_3601254" style="left:-9.14px;top:-1.345px;"><div id="svg0_3601254" style="left:9.14px;top:1.061px;"><svg width="1280" height="83" viewBox="0 0 1280 83"><path fill="#d9d9d9" d="M0,0 h1280 v82.161 h-1280 Z"/></svg></div><div id="svg1_3601254" style="left:104.609px;top:2.508px;"><svg width="1687" height="78" viewBox="0 0 1687 78"><path fill="none" d="M0,0 h1686.531 v77.558 h-1686.531 Z"/></svg></div><div id="spr4_3601254" style="left:90.352px;top:0px;"><div id="svg3_3601254" style="left:0px;top:0px;"><svg width="83" height="82" viewBox="0 0 83 82"><g fill="none"><path fill="#ffffff" d="M0,81.616 L41.287,0 L82.574,81.616 Z"/></g></svg></div></div><div id="spr5_3601254" style="top:23.068px;"><div id="spr6_3601254"><img id="img0_3601254" src="data:image/png;base64," width="66" height="39" alt="" style="left:0.14px;top:-0.23px;"/></div></div></div><div id="spr7_3601254" style="left:-346.652px;top:500.522px;"><div id="spr8_3601254"><img id="img1_3601254" src="data:image/png;base64," width="1653" height="39" alt="" style="left:0.152px;top:0.239px;"/></div></div></div><div id="spr2_3601254" class="kern slide"><div id="spr9_3601254" style="left:96px;top:-1.345px;"><div style="width:0px;"><span id="txt0_3601254" data-width="783.811035" style="left:7.2px;top:16.631px;">Mounting and Inspection of Abrasive Wheels</span></div></div><div id="spr10_3601254" style="left:48px;top:126px;"><div style="width:0px;"><span id="txt1_3601254" class="nokern relpos" dir="auto" style="left:7.2px;top:0.302px;">•</span> <span id="txt2_3601254" class="relpos" data-width="353.917969" style="left:27.898px;top:-2.233px;">All wheels must be examined before mounting.</span></div><div style="width:0px;"><span id="txt3_3601254" class="nokern relpos" dir="auto" style="left:7.2px;top:21.812px;">•</span> <span id="txt4_3601254" class="relpos" data-width="376.936523" style="left:27.898px;top:19.276px;">A ring test must be conducted to ensure they have</span></div><div style="width:0px;"><span id="txt5_3601254" data-width="347.018555" style="left:34.2px;top:36.647px;">not been damaged during transit, storage, etc.</span></div><div style="width:0px;"><span id="txt6_3601254" class="nokern relpos" dir="auto" style="left:7.2px;top:60.692px;">•</span> <span id="txt7_3601254" class="relpos" data-width="182.487305" style="left:27.898px;top:58.156px;">To conduct the ring test:</span></div><div style="width:0px;"><span id="txt8_3601254" class="nokern relpos" dir="auto" style="left:43.2px;top:82.292px;">–</span> <span id="txt9_3601254" class="relpos" data-width="348.952148" style="left:55.689px;top:79.756px;">“Tap” the wheels about 45 degrees each side of</span></div><div style="width:0px;"><span id="txt10_3601254" data-width="338.097656" style="left:65.7px;top:97.127px;">the vertical midline and about 1-2 inches from</span></div><div style="width:0px;"><span id="txt11_3601254" data-width="104.167969" style="left:65.7px;top:114.407px;">the periphery.</span></div><div style="width:0px;"><span id="txt12_3601254" class="nokern relpos" dir="auto" style="left:43.2px;top:138.452px;">–</span> <span id="txt13_3601254" class="relpos" data-width="322.831055" style="left:55.689px;top:135.916px;">Rotate the wheel 45 degrees and repeat the</span></div><div style="width:0px;"><span id="txt14_3601254" data-width="32.598633" style="left:65.7px;top:153.287px;">test.</span></div><div style="width:0px;"><span id="txt15_3601254" class="nokern relpos" dir="auto" style="left:43.2px;top:177.332px;">–</span> <span id="txt16_3601254" class="relpos" data-width="327.427734" style="left:55.689px;top:174.796px;">Undamaged wheels will have a clear metallic</span></div><div style="width:0px;"><span id="txt17_3601254" data-width="49.447266" style="left:65.7px;top:192.167px;">sound.</span></div><div style="width:0px;"><span id="txt18_3601254" class="nokern relpos" dir="auto" style="left:43.2px;top:216.212px;">–</span> <span id="txt19_3601254" class="relpos" data-width="344.452148" style="left:55.689px;top:213.676px;">If the wheel is cracked, there will not be a clear</span></div><div style="width:0px;"><span id="txt20_3601254" data-width="47.944336" style="left:65.7px;top:231.047px;">“ring”.</span></div><div style="width:0px;"><span id="txt21_3601254" class="nokern relpos" dir="auto" style="left:7.2px;top:255.092px;">•</span> <span id="txt22_3601254" class="relpos" data-width="344.003906" style="left:27.898px;top:252.556px;">The machine’s spindle speed must be checked</span></div><div style="width:0px;"><span id="txt23_3601254" data-width="368.068359" style="left:34.2px;top:269.927px;">before mounting wheels to ensure that it doesn’t</span></div><div style="width:0px;"><span id="txt24_3601254" data-width="367.699219" style="left:34.2px;top:287.207px;">exceed the maximum operating speed as marked</span></div><div style="width:0px;"><span id="txt25_3601254" data-width="102.858398" style="left:34.2px;top:304.818px;">on the wheel.</span></div></div><div id="spr11_3601254" style="left:488px;top:145.187px;"><div id="spr12_3601254"><img id="img2_3601254" src="data:image/jpeg;base64," width="424" height="318" alt=""/></div></div></div></div>', '{"s":[]}');})();